head.script:
scwin.onpageload = function() {
	var locale = WebSquare.cookie.getCookie("system_language") || multiLang.getLocale();
	multiLang.setLocale(locale);
	sel_multiLang.setValue(locale);

	// current time (use tzOffset)
	var timeObj = multiLang.getFormattedWorldTime();
	txt_time.setValue(timeObj.time + " (GMT " + timeObj.gmt + ")");

	// cuurent date (UTC)
	txt_date.setValue(multiLang.getFormattedUTCDate() + " GMT");
	dl_defaultOptions.setJSON(multiLang.defaultOptions);
};

scwin.onpageunload = function() {
};

scwin.sel_wordShortening_onchange = function() {
	var bindLabel = '', value = sel_multiLang.getValue();
	if (this.getValue() == "short") {
		bindLabel = "CODENM_S";
	} else {
		bindLabel = "CODENM_F";
	}
	sel_multiLang.setNodeSet("data:dl_cm_nation", bindLabel, "CODE");
	sel_multiLang.setValue(value);
};

scwin.sel_multiLang_onviewchange = function(info) {
	multiLang.setLocale(this.getValue(), dl_defaultOptions.getJSON());

	if (info.oldValue != info.newValue) {
		WebSquare.cookie.setCookie("system_language", this.getValue());
		// SPA 방식으로 화면만 Refresh 되도록 처리할 때 
		// delete WebSquare.BootLoader.importCache["message/" + this.getValue() + ".js"];
		// delete WebSquare.BootLoader.importCache["/sp4_unofficial/mutiLang/client/common/lang/client_" + this.getValue() + ".js"];
		// WebSquare.BootLoader.requires("message/" + this.getValue() + ".js");
		// WebSquare.BootLoader.requires("/sp4_unofficial/mutiLang/client/common/lang/client_" + this.getValue() + ".js");
		scwin.reOpen();
	}
};

scwin.reOpen = function() {
	// SPA 방식으로 화면만 Refresh 되도록 처리할 때
	// $p.reinitialize();
	$p.reinitialize(true);
};

scwin.getEconomicCalendar = function(locale) {
	var dlCal = "dl_cal_" + locale;
	dl_cal.setArray(eval(dlCal).getAllArray());

};

scwin.getWorldIndex = function(locale) {
	var dlIndex = "dl_index_" + locale;
	dl_index.setArray(eval(dlIndex).getAllArray());
};

scwin.btn_sch_onclick = function() {
	var locale = multiLang.getLocale();

	dl_cal.removeAll();
	dl_index.removeAll();

	multiLang.setLocale(locale, dl_defaultOptions.getJSON());
	scwin.getEconomicCalendar(locale);
	scwin.getWorldIndex(locale);
};

// National Number Format
scwin.setNumberFormat = function(data) {
	var formattedData = multiLang.getDisplayNumberFormat(data);
	return formattedData;
};

// National Number Format & Custom Format
scwin.setCustomNumberFormat = function(data, formatted, row, col) {
	var colId = grd_index.getColumnID(col);
	var locale = multiLang.getLocale().toLowerCase();
	var formattedData = multiLang.getDisplayNumberFormat(data);
	var pColor = "#0ea600";
	var nColor = "#ff0000";

	if (locale == 'ko') {
		pColor = "#ff0000";
		nColor = "#048DE3";
	} else {

	}

	if (data > 0) {
		grd_index.setCellColor(row, col, pColor);
		formattedData = "+" + formattedData;
	} else if (data < 0) {
		grd_index.setCellColor(row, col, nColor);
	}

	if (colId == "ChgPer") {
		return formattedData + "%";
	}

	return formattedData;
};

// National Date Format 
scwin.setDateFormat = function(data) {
	var formattedData = multiLang.getFormattedWorldDate(data);
	return formattedData;
};
